import React, { Component } from 'react';

import Container from 'react-bootstrap/Container'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'
import Image from 'react-bootstrap/Image'
import Button from 'react-bootstrap/Button'
import Carousel from 'react-bootstrap/Carousel'

import Background from '../assets/slideshowBackground.jpg'

import Forbes from '../assets/portfolio/forbes.JPG'
import HackPSU from '../assets/portfolio/hackpsu.jpeg'
import Jacob from '../assets/portfolio/jacob.jpg'

const styles = {
	background: {
		backgroundImage: `url(${Background})`,

		/* Center and scale the image nicely */
	    backgroundPosition: 'center',
	    backgroundRepeat: 'no-repeat',
	    backgroundSize: 'cover',
	}
}

class Slideshow extends Component {
  render() {

    return (
		<Container fluid style = {styles.background} id="projects" className = "vh-100 vw-100">
		  <Row md = {12} className = "p-5">
		    <Col md = {3}>
		    	<Carousel>
				  <Carousel.Item>
				    <img
				      className="d-block w-100"
				      src={Forbes}
				      alt="First slide"
				    />
				  </Carousel.Item>

				  <Carousel.Item>
				    <img
				      className="d-block w-100"
				      src={HackPSU}
				      alt="Third slide"
				    />
				  </Carousel.Item>

				  <Carousel.Item>
				    <img
				      className="d-block w-100"
				      src={Jacob}
				      alt="Third slide"
				    />
				  </Carousel.Item>
				</Carousel>
		    </Col>
		  </Row>
		</Container>
    );
  }
}

export default Slideshow;
